INSERT INTO `announcements_mainpageblurbs` VALUES (1,'Farm invites after 3/30/2020 are canceled until further notice. We need to stop thinking \"I can\'t catch this\" to \"I have this and don\'t want to give it to others.\"',0),(2,'The blurb needs to be bigger...',0),(3,'<ul>\r\n<li>Not all shooters are the same. That part\'s obvious but also, not all firearms are created alike. Even if they are the same make and manufacture for the same caliber, they are different. They might be close but close only counts with hand grenades and nuclear war.</li><br />\r\n\r\n<li>With that in mind, I\'ve hidden the load detail for my loads unless you\'re signed in. Logins are restricted to myself and 1-2 others. Don\'t ask for an account.</li><br />\r\n\r\n<li>I\'m updating this website roughly once a week with new features. Most will be hidden for a typical user but more for me in the background. However, this also means that the site will go down from time to time for reboots and things like that.</li><br />\r\n\r\n<li>Farm invites for 2021 are going to be limited. I\'ve got a few people that are \'always welcome\' at the farm but others are restricted and controlled by invite. The best way to get put on a blacklist, is to ask for an invite saying you\'re a great shooter/sniper/police/operator etc etc. Go do that somewhere else.</li><br />\r\n\r\n<li>COVID-19 is a thing, even if it\'s not a thing then we should learn from the event and keep distances unless we have a specific reason to violate personal space.</li><br />\r\n\r\n</ul>',0),(4,'Not all shooters are the same. That part\'s obvious but also, not all firearms are created alike. Even if they are the same make and manufacture for the same caliber, they are different. They might be close but close only counts with hand grenades and nuclear war.<br /><br />\r\n\r\nWith that in mind, I\'ve hidden the load detail for my loads unless you\'re signed in. Logins are restricted to myself and 1-2 others. Don\'t ask for an account.<br /><br />\r\n\r\nI\'m updating this website roughly once a week with new features. Most will be hidden for a typical user but more for me in the background. However, this also means that the site will go down from time to time for reboots and things like that.<br /><br />\r\n\r\nFarm invites for 2021 are going to be limited. I\'ve got a few people that are \'always welcome\' at the farm but others are restricted and controlled by invite. The best way to get put on a blacklist, is to ask for an invite saying you\'re a great shooter/sniper/police/operator etc etc. Go do that somewhere else.<br /><br />\r\n\r\nCOVID-19 is a thing, even if it\'s not a thing then we should learn from the event and keep distances unless we have a specific reason to violate personal space.<br /><br />',1),(5,'this is a test.',1),(6,'Not all shooters are the same. That part\'s obvious but also, not all firearms are created alike. Even if they are the same make and manufacture for the same caliber, they are different. They might be close but close only counts with hand grenades and nuclear war.<br /><br />\r\n\r\nWith that in mind, I\'ve hidden the load detail for my loads unless you\'re signed in. Logins are restricted to myself and 1-2 others. Don\'t ask for an account.<br /><br />\r\n\r\nI\'m updating this website roughly once a week with new features. Most will be hidden for a typical user but more for me in the background. However, this also means that the site will go down from time to time for reboots and things like that.<br /><br />\r\n\r\nFarm invites for 2021 are going to be limited. I\'ve got a few people that are \'always welcome\' at the farm but others are restricted and controlled by invite. The best way to get put on a blacklist, is to ask for an invite saying you\'re a great shooter/sniper/police/operator etc etc. Go do that somewhere else.<br /><br />\r\n\r\nCOVID-19 is a thing, even if it\'s not a thing then we should learn from the event and keep distances unless we have a specific reason to violate personal space.<br /><br />',1);
