INSERT INTO `announcements_pageblurboverrides` VALUES (1,'This is my little black book of reloading. Make your own, don\'t use mine. Some of these are already hot in my firearm and might be a pipe bomb in yours. Use your head, don\'t loose your hands etc etc.','load_data/loads/'),(2,'I like big foot-pounds and can not lie!','load_data/foot_pound_calculator/'),(3,'The fundamental steps haven\'t changed, it\'s not going to change for you just because of a new firearm you snowflake!','shooting_logbook/six_steps/'),(4,'It\'s not out of focus, it\'s you reading the wind.','shooting_logbook/reading_wind_mirage/'),(5,'My rifle is my best friend. It is my life. I must master it as I must master my life.','load_data/firearm_detail/'),(6,'Even authorities like some DOPE (Data On Previous Knowledge [or Data On Personal Equipment]).','load_data/estimated_dope/'),(7,'News or fake news, who cares. Have fun and be yourself.','news/'),(8,'COVID-19 has dangers worse than unprotected sex but you don\'t know who your partner is.','/'),(9,'Approved 4/16/2020, IN HAND 5/28/2020. [220 days]','/days_since?input_date=10/22/2019'),(10,'Approved May 11th 2020, IN HAND July 2nd 2020. (260 days total)','/days_since?input_date=11/2/2019'),(11,'The day Maryland was told to stand still... alone.','/days_since?input_date=3/18/2020'),(12,'Rifleman\'s Creed','/news/detail/18'),(13,'Farm invites are shut down for now.','/news/detail/21'),(14,'A message from Appleseed.','/news/detail/22'),(15,'Let someone/something else shop for you, use AmmoSeek.','/news/detail/23'),(16,'Limited access. More to come later but for now, excuse the clunkyness.','load_data/toolbox/create_caliber/'),(17,'Brace yourself, authentication is no longer required. Times are estimated prior to 6/22/2020.','groundhog_logbook/by_shooter/'),(18,'Removals are an all time record.','groundhog_logbook/removal_scoreboard/'),(19,'Don\'t add powder that is the same thing. Example: IMR 4064, IMR_4064, IMR4064.','load_data/toolbox/create_powder/'),(20,'Don\'t add projectiles that are the same thing. Example: AMAX, A-MAX, A MAX.','load_data/toolbox/create_projectile/'),(21,'Charts are \"coming soon\", ish.','groundhog_logbook/charts/');
