INSERT INTO `announcements_whatisnew` VALUES (1,'2020-01-27','Added: What is new!','I\'ve added a latest news section or <i>what is new</i> which is similar to a blog but will only show the most recent published article. I\'ll probably take this and make it like a blog at some point but for now it\'s just a \'latest news\' section.',1,0,NULL),(2,'2020-01-26','Consolidated global functions','I consolidate global functions in the code base. This allowed me to reuse the same code in various portions of the website. I had tried before but I couldn\'t get them to display properly. I\'m not sure what I was doing wrong before but it seems to be working now!',1,0,NULL),(3,'2020-01-28','Bad Contact Info','A spot may have opened up for Saturday morning due to bad contact info. I\'ll give him another day to reply but then I\'ll open it up to others. Some lady got \'random\' text messages from me this evening. Hahhaa good thing I send out a PING type text message first.',1,0,NULL),(4,'2020-01-29','Shuffle Shuffle','I\'ve had to shuffle a couple of registrations here and there due to plans my amazing wife made for me that I didn\'t know about. Happy wife, happy life.',1,0,NULL),(5,'2020-02-05','Shifted data models','I shifted the data model a bit to a more logical composure. It doesn\'t mean much to most of the visitors/guests of this site right now though. In the long run, users will be able to store their own load data and DOPE on the website if they choose. The site began transitions to accommodate this.',1,0,NULL),(7,'2020-02-07','Master Po talks about 6 little steps','The experience of thousands of shooters over the last few hundred years has been distilled down to\r\n        these six steps for firing the shot. If you will put aside all notions on shooting acquired until now and try\r\n        this, it will improve your shooting. If you fire every shot &#8220;by the numbers&#8221; you will improve.\r\n\r\n\r\nRead the <a href=\"https://benspelledabc.me/shooting_logbook/six_steps/\">6 Little Steps</a>.',1,0,NULL),(8,'2020-02-10','Added shot logger','I\'ve added a shot log book to the site. Users have accounts, create a profile w/ firearm (or firearms), and load details. Once that is done, they can log their shots. It\'s needs a few more things before it really gets released but for now it\'s working.. just not easy to use hahaa.',1,0,NULL),(9,'2020-02-17','Ardunino Uno','This article is just here to serve as a light end point to test my arduino uno code. I wanted a light weight endpoint, this is it!',1,0,NULL),(10,'2020-02-22','100+ Virgin','Today both guests had to back out but it worked out because a secondary person was able to backfill the the slot. Too it off with; this guest had never shot past 100yards. We zeroed his rifle then Kentucky windage got 3 shots on shotgun clays at 200 yards in only 3-4 misses. He was stoked. \r\n\r\nI let him shoot one of my rifles at a dvd sized gong at 540 yards. Wind grabbed the bullet and juuuuust missed it. Got it on the next shout though. \r\n\r\nI’ve decided to put wind veins (flags) at the target out yonder. It lets you get real-time indicator of the wind direction and speed. We found about 80% of the time... it’s NOT doing what you feel in your face.',1,0,NULL),(11,'2020-02-26','Rotations Per Second','I added a rotations per second output field to the load data. The formula for RPM is V * 720 / TwistRate, which I divide again by 60 for RPS. Check it out on the <a href=\"/load_data/loads/\">load data</a> page.',1,0,NULL),(12,'2020-02-28','Farm Invite data model change.','I\'ve come to the realization that I need a check box for people that I work with so I can sort on that. This allows me to \'pre-approve\' people among other things.',1,0,NULL),(13,'2020-03-03','Obligations','Due to personal obligations, I\'m going to have to cancel several trips to the farm this year. <br /><br />\r\n\r\nI\'ve made a note of who you are and will revisit next year. All the guests have been great. \r\nThey all had a great time and I didn\'t get indexed a single time. \r\n\r\n<br /><br />\r\nAll of the gongs are okay but some\r\n of the dueling tree plate holders got ripped up a bit. Jerking the trigger or zero being 4 MOA off\r\n to the left/right... does a number on the frames. Sadly, this means I\'ll want to do an shooting skill assessment\r\n before allowing people to shoot the dueling trees with rifles. The good news is, they still function!',1,0,NULL),(14,'2020-03-10','No Logins','I can\'t tell you how many times I\'ve \r\nbeen told they can\'t login to the site. There is no login for anyone other than me at this time. Which was on the \r\nlogin page itself but people don\'t read it. Login is a magical link, they see it and <i>MUST.. CLICK...LINK</i> zombies come out. \r\n\r\n<br /><br />\r\nPlease understand how this looks super bad when you don\'t read. When dealing with firearms and strangers I get a little \r\njittery in the first place. Combine that with someone that can\'t/won\'t read instructions and all bets are off. 90% of the \r\ntimes I\'ve been indexed are from \"military\" or \"special forces\" guys that let their egos get in front of safey. Sure, I\'m \r\nstill here and I only have the holes given to me at birth but egos build complicity... and that\'s where I draw the line. If \r\nyou feel that\'s too harsh, you\'re probably part of the problem.',1,0,NULL),(15,'2020-03-11','Sticky News','I\'ve added a sticky bit to posts. They will appear at the top of the news posts regardless of date published. They also have the <b>Noodly One</b> next to the title of the sticky post.',1,0,NULL),(16,'2020-03-12','COVID-19 Affected Map','I\'m pulling the image from CDC.gov use their website for better info not mine obviously. <br /><br />\r\n<img style=\"width:700px;\" src=\"https://www.cdc.gov/coronavirus/2019-ncov/images/outbreak-coronavirus-world.png\" />',1,0,NULL),(17,'2020-03-13','Groundhog hole map','I\'m going to start storing the lat/long info for groundhog holes. Perhaps a way to count the number of groundhogs per location also. I would like to have a way to track them so i know if i\'m having ANY effect on them. I remove 20-40 groundhogs a year and still at it. Groundhog hole <a href=\"https://benspelledabc.me/groundhog_logbook/locations/\">list</a>.',1,0,NULL),(18,'2020-03-20','Rifleman\'s Creed','This is my rifle. There are many like it, but this one is mine.<br />\r\nMy rifle is my best friend. It is my life. I must master it as I must master my life.<br /><br />\r\n\r\nWithout me, my rifle is useless. Without my rifle, I am useless. I must fire my rifle true. I must shoot straighter than my enemy who is trying to kill me. I must shoot him before he shoots me. I will ...<br /><br />\r\n\r\nMy rifle and I know that what counts in war is not the rounds we fire, the noise of our burst, nor the smoke we make. We know that it is the hits that count. We will hit ...<br /><br />\r\n\r\nMy rifle is human, even as I, because it is my life. Thus, I will learn it as a brother. I will learn its weaknesses, its strength, its parts, its accessories, its sights and its barrel. I will keep my rifle clean and ready, even as I am clean and ready. We will become part of each other. We will ...<br /><br />\r\n\r\nBefore God, I swear this creed. My rifle and I are the defenders of my country. We are the masters of our enemy. We are the saviors of my life.<br /><br />\r\n\r\nSo be it, until victory is America\'s and there is no enemy, but peace!<br />',1,0,NULL),(19,'2020-03-20','Added database driven blurbs','I updated the back-end of the website to allow the message blurbs to be updated easier. It\'s not fool proof but it\'ll do... It\'ll do.',1,0,NULL),(20,'2020-03-22','Adding Projectile Links','With the update to <a href=\"http://ammoseek.com\">ammoseek.com</a> I\'m going to update the site to link directly to the projectiles used. Here is an example of the 69gr bullet I use, <a href=\"https://ammoseek.com/reloading/bullets/.224-diameter/Sierra-69grains?ikw=matchking&ekw=tipped\" target=\"_blank\">here</a>.',1,0,NULL),(21,'2020-03-02','Farm Invite: STATUS','<b>Closed</b>. <b><i>COVID-19</i></b> has prompted a closure of invites. They will resume at a later time and I\'ll update the status accordingly.',1,0,NULL),(22,'2020-03-25','Improvise, adapt and overcome','I got an email this morning from a person who\'s part of Project Appleseed. I wanted to share it with you all.<br /><br /><br />\r\n<br />Improvise, adapt and overcome.\r\n<br />\r\n<br />These words are an essential part of the message that Project Appleseed relates to America. They define the character of the Appleseed instructor. And they are exemplified by the great Americans that Project Appleseed memorializes, like Isaac Davis, Samuel Whittemore and Elizabeth Zane.\r\n<br />\r\n<br />Improvise, adapt and overcome.\r\n<br />\r\n<br />Never before has this mantra been as relevant to Americans as it is today. And never before has Appleseed been more relevant.  The Covid-19 pandemic means self-sufficiency will be the order of the day. It means that we will have to find new ways to accomplish routine tasks. It means that Americans’ priorities will be reset. And it means that there will be a greater need than ever for Project Appleseed.\r\n<br />\r\n<br />Improvise, adapt and overcome.\r\n<br />\r\n<br />For those of us who have survived natural disasters, those words have a personal meaning. Over the past 30 years, I’ve lived through five hurricanes and a tropical storm that have ripped the roof off my home, destroyed my possessions, forced us to use boats to get around our neighborhood, and taught us to live without electricity, organize our neighborhoods  for security and get along without many of the niceties of modern living. And we survived just fine. \r\n<br />\r\n<br />Improvise, adapt and overcome.\r\n<br />\r\n<br />The challenges are going to be many. But we <i>are</i> Appleseed. We are more than equal to the task. We have the wisdom of our ancestors and the indefatigable spirit of those who stood up on April 19, 1775, to guide us.\r\n<br />\r\n<br />Our shoots may be smaller. Our cadres may only operate locally. But there will be a greater relevance to our instruction.  People expect the crisis to bring out the worst in their neighbors. But my experience is just the opposite: Hardship brings out the best in Americans. \r\n<br />\r\n<br />In this time of darkness, let us shine.\r\n<br />\r\n<br />Let us stand up and be leaders in our communities.  In the digital age, we don’t need to meet face to face to lead our community. Let us look after each other and help keep each other safe.\r\n<br />\r\n<br />And above all, let us not forget our ideals. As John Adams warned us, our ancestors are watching in judgement. Let us make them proud of their progeny.  It is time to show what we are made of.  We <i>will</i> improvise, adapt and overcome.\r\n<br />\r\n<br />We have a country to save. And we will not falter.',1,0,NULL),(23,'2020-03-28','Added AmmoSeek links','I\'ve added links to several components that takes you to AmmoSeek\'s website. AmmoSeek has saved me so much time and money, I\'ll never use anything else while it\'s active.',1,0,NULL),(24,'2020-03-29','52gr Matchking','mmMmMMM 22-250 laser beams.. <a href=\"https://www.midsouthshooterssupply.com/item/000071410c/22-caliber-point224-diameter-52-grain-hollow-point-boat-tail-matchking-500-count\" target=\"_blank\"><i class=\"fas fa-shopping-cart\"></i> BUY NOW</a>.',1,0,NULL),(25,'2020-03-31','Users can now add calibers!','I\'m adding the ability for users to add information to the website in a controlled way. Tonight I added the ability to add calibers. They don\'t get approved by default, I\'ll have to go in and approve them. This should cut down on spam. Also, if there are too many submissions from a user w/in X time the account may or may not get disabled and held for questioning.<br /><br />\r\n\r\nNext I\'ll be adding the ability to add projectiles, then powder, then hand-loads of approved items. Once that\'s done, you\'ll be able to add your own firearm info if you choose. No biggy, it\'s just me learning a new language and you\'ll benefit from my learning process as well!',1,0,NULL),(26,'2020-03-31','Top groundhog removers!','I\'m working on adding a scoreboard type of display. The list will show the primary locations that groundhogs are being removed and who\'s doing the most removing. This is mostly for a \'how do I do this in django/python\' but also for tracking for next year.<br /><br />The problem right now is that the result is the <i>user id/pk</i> instead of the <i>username</i> for said user. This isn\'t very user friendly for displays. I\'ve reached out to a co-worker to see if he can provide some assistance. Hang in there!',1,0,NULL),(27,'2020-04-03','Adding \"buy me\" links.','I found another spot that there are no links to the products to buy. IE: on the groundhog logbook ( <a href=\"https://benspelledabc.me/groundhog_logbook/by_shooter/\" target=\"_blank\">shown here</a> ), it shows the \"load detail\" but doesn\'t show links to the projectile or powder. That\'s what i\'m going to update next when i have time.<br /><br />I may NOT do this because it\'s hard coded into the data model at the moment. I don\'t want to jack w/ that at this time.',1,0,NULL),(28,'2020-04-12','Image upload','\"It works on my dev box!\" hahah but seriously, it works on dev and on test. When I try to put it on production, it doens\'t work. Nginx gives a server 500 error. I\'m not sure what it is at this time, i\'ll figure it out eventually. Turns out, the production server IS NOT \"just like\" the dev/test box. WHO KNEW!?<br /><br />\r\nI figured it out! It was a setting in the nginx.conf file that was slightly different on production than it was on test. I changed it to match what was on test and BAM SON... it works just fine now!',1,0,NULL),(30,'2020-05-11','A sample reloading shopping list.','This list is a decent list of materials. Several of these have options. I\'ll talk to you about them in person. It\'s too much to put in here as a news post at this time. \r\n\r\n<table class=\"table table-bordered table-hover table-condensed\">\r\n<thead><tr><th title=\"Field #1\">quick name</th>\r\n<th title=\"Field #2\">usdollars</th>\r\n<th title=\"Field #3\">optional</th>\r\n<th title=\"Field #4\">link</th>\r\n</tr></thead>\r\n<tbody><tr>\r\n<td>reloading machine</td>\r\n<td>$457.00</td>\r\n<td>no</td>\r\n<td>https://www.dillonprecision.com/rl-550c-reloader_8_1_23594.html</td>\r\n</tr>\r\n<tr>\r\n<td>strong mount</td>\r\n<td>$59.99</td>\r\n<td>no</td>\r\n<td>https://www.dillonprecision.com/rl-550-xl-650-xl-750-strong-mount_8_1_23596.html</td>\r\n</tr>\r\n<tr>\r\n<td>chamfer/debur</td>\r\n<td>$19.95</td>\r\n<td>no</td>\r\n<td>https://www.amazon.com/Hornady-050117-4-Blade-Chamfer-Deburring/dp/B078489V3X/ref=sr_1_2?dchild=1&amp;keywords=lyman+deburring+tool&amp;qid=1589237521&amp;sr=8-2</td>\r\n</tr>\r\n<tr>\r\n<td>300blk case gauge</td>\r\n<td>$25.23</td>\r\n<td>no</td>\r\n<td>https://www.amazon.com/Lyman-Products-Blackout-Length-Headspace/dp/B00URUECKC/ref=sr_1_1?crid=V66SM18M8344&amp;dchild=1&amp;keywords=300+blk+case+gauge&amp;qid=1589237677&amp;sprefix=300+blk+case+%2Caps%2C126&amp;sr=8-1</td>\r\n</tr>\r\n<tr>\r\n<td>ultra sonic cleaner</td>\r\n<td>$125.59</td>\r\n<td>no</td>\r\n<td>https://www.amazon.com/Hornady-043320-Lock-N-Load-Sonic-Cleaner/dp/B007TNX9ZE/ref=sr_1_2?crid=3061ZN91ANYG&amp;dchild=1&amp;keywords=hornady+ultrasonic+cleaner+solution&amp;qid=1589237785&amp;sprefix=hornady+ultra%2Caps%2C133&amp;sr=8-2</td>\r\n</tr>\r\n<tr>\r\n<td>bullet puller no collet</td>\r\n<td>$22.99</td>\r\n<td>yes</td>\r\n<td>https://www.amazon.com/RCBS-9440-Bullet-Puller-without/dp/B000N8N1YQ/ref=sr_1_3?dchild=1&amp;keywords=collet+bullet+puller&amp;qid=1589238765&amp;sr=8-3</td>\r\n</tr>\r\n<tr>\r\n<td>22 cal bullet puller</td>\r\n<td>$16.98</td>\r\n<td>yes</td>\r\n<td>https://www.amazon.com/RCBS-Bullet-Puller-Collet-22-Caliber/dp/B000N8QKRG/ref=psdc_4200921_t2_B000N8N1YQ</td>\r\n</tr>\r\n<tr>\r\n<td>reloading manual 1</td>\r\n<td>$33.50</td>\r\n<td>no</td>\r\n<td>https://www.amazon.com/Hornady-99240-Reloading-Manual-Pages/dp/B01MAUZ71V/ref=sr_1_1?crid=2LR88JE2PCNH1&amp;dchild=1&amp;keywords=hornady+reloading+manual&amp;qid=1589238889&amp;sprefix=hornady+reload%2Caps%2C131&amp;sr=8-1</td>\r\n</tr>\r\n<tr>\r\n<td>digital caliper</td>\r\n<td>$37.59</td>\r\n<td>no</td>\r\n<td>https://www.amazon.com/Hornady-500806-050080-Digital-Caliper/dp/B001KZ3NOO/ref=sr_1_13?dchild=1&amp;keywords=digital+caliper&amp;qid=1589242463&amp;sr=8-13</td>\r\n</tr>\r\n<tr>\r\n<td>digital scale</td>\r\n<td>$28.96</td>\r\n<td>no</td>\r\n<td>https://www.amazon.com/Frankford-Arsenal-Digital-Reloading-Display/dp/B002BDOHNA/ref=sr_1_1?crid=3VMMAN0I6WJPQ&amp;dchild=1&amp;keywords=frankford+digital+scale&amp;qid=1589242512&amp;sprefix=frankford+digital+scale%2Caps%2C179&amp;sr=8-1</td>\r\n</tr>\r\n<tr>\r\n<td>awesome trimmer</td>\r\n<td>$75.95</td>\r\n<td>no</td>\r\n<td>https://www.amazon.com/Worlds-Finest-Trimmer-223-Rem/dp/B009NKJXFQ/ref=sr_1_1?dchild=1&amp;keywords=brass+trimmer&amp;qid=1589242637&amp;sr=8-1</td>\r\n</tr>\r\n<tr>\r\n<td>case lube</td>\r\n<td>$9.99</td>\r\n<td>no</td>\r\n<td>https://www.amazon.com/Hornady-9991-Spray-DynaGlide-Aerosol/dp/B0001NA29U/ref=sr_1_1?dchild=1&amp;keywords=one+shot+case+lube&amp;qid=1589243095&amp;sr=8-1</td>\r\n</tr>\r\n<tr>\r\n<td><strong>EXTRAS FOR MORE</strong></td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n<tr>\r\n<td>good trimmer</td>\r\n<td>$29.95</td>\r\n<td>yes *</td>\r\n<td>https://www.amazon.com/Lyman-Products-ZEE-Trimmer-Rifle/dp/B00AU6C7MI/ref=sr_1_3?dchild=1&amp;keywords=lee+brass+trimmer&amp;qid=1589242788&amp;sr=8-3</td>\r\n</tr>\r\n<tr>\r\n<td>good trimmer 300blk </td>\r\n<td>$9.91</td>\r\n<td>yes *</td>\r\n<td>https://www.amazon.com/Lyman-ZEE-Trim-Pilot-Black-Out/dp/B00I6OS2PW/ref=sr_1_1?dchild=1&amp;keywords=lee+e-zee+trim+300+blackout&amp;qid=1589242961&amp;sr=8-1</td>\r\n</tr>\r\n<tr>\r\n<td>primer flipper tray</td>\r\n<td>$6.95</td>\r\n<td>yes</td>\r\n<td>https://www.amazon.com/RCBS-09480-Primer-Tray-2/dp/B000N8HW3M/ref=sr_1_1?dchild=1&amp;keywords=primer+flipping+tray&amp;qid=1589243134&amp;sr=8-1</td>\r\n</tr>\r\n<tr>\r\n<td>locator pin tabs</td>\r\n<td>$0.99</td>\r\n<td>yes</td>\r\n<td>https://www.amazon.com/Locator-Dillon-Reloading-Press-XL650/dp/B084BQRJJV/ref=sr_1_fkmr1_1?dchild=1&amp;keywords=dillon+550+caliber+conversion&amp;qid=1589244457&amp;s=sporting-goods&amp;sr=1-1-fkmr1</td>\r\n</tr>\r\n<tr>\r\n<td>second powder head</td>\r\n<td>$145.19</td>\r\n<td>yes</td>\r\n<td>https://www.amazon.com/Dillon-Precision-Deluxe-Change-Assembly/dp/B00T3OELRC/ref=sr_1_12?dchild=1&amp;keywords=dillon+550+toolhead&amp;qid=1589244316&amp;sr=8-12</td>\r\n</tr>\r\n<tr>\r\n<td>caliber conversion kit</td>\r\n<td>$52.99</td>\r\n<td>yes</td>\r\n<td>https://www.dillonprecision.com/rl-550-caliber-conversion-kit_8_2_23598.html</td>\r\n</tr>\r\n<tr>\r\n<td>bullet tray</td>\r\n<td>$47.99</td>\r\n<td>yes</td>\r\n<td>https://www.dillonprecision.com/bullet-tray-square-deal-b-rl-550-xl-650-xl-750_8_1_23597.html</td>\r\n</tr>\r\n</tbody></table>',1,1,NULL),(31,'2020-06-22','Added Second Image','There have been too many times that I wanted to share more than one image. I\'ve setup the site to allow two images. Really what would be better is to allow \"several\" images but two is fine for now.',1,0,NULL),(32,'2020-06-22','Added Time To Groundhog Logbook','I\'ve added a timestamp to the database in attempt to figure out when the groundhogs are being dispatched. Times before 6/22/2020 are estimated, which is why it\'s a field now so I don\'t have to estimate. I suppose the images on my phone should have metadata to them which shows the date/time. We\'ll see if it does or not later. If it does, I\'ll update the times accordingly.',1,0,NULL),(33,'2020-06-27','Name change','I decided to change/normalize the name of the website. Short sweet and easy to understand over my traditional \"IMRUnicorn\" name.',1,0,NULL),(34,'2020-06-30','Load Development Process Trail Change','<p>For a few years now I\'ve been using Dan Newberry\'s OCW (optimal charge weight) load development system. It had it\'s advantages over a traditional ladder development but presented its own issues. If the shooter screwed up and pulled it, the test was out. All other kinds of \"range reasons\" but that was the biggest one. The process that\'s new to me is something that seems to yield similar results but take the \"bad shooter\" out of the development process.</p>\r\n\r\n<p>I did it for a groundhog 308 load I have and i\'m super happy with the results. So much so that I might redo some other \"known good loads\" to see if my results were skewed. If i can get the SD/ES down into single digits AND have a sub-MOA group, I\'m beyond happy for the shooting I do.</p>',1,0,''),(35,'2020-07-06','BugFix: Firearm Detail','Every time you change your barrel or things attached to it you should verify your zero. If that change is a suppressor which may or may not always be attached you run into a challenge. The challenge is remembering both zeros for multiple firearms or writing it down. I\'ve decided to do the latter and just write it down, on this website. I already had a section for \"extra info\" but i wanted to break it up into paragraphs for readability. <a href=\"https://benspelledabc.me/load_data/firearm_detail/4\">Check it out</a>.',1,0,NULL),(36,'2020-07-13','Adding an endpoint','Check it out, <a href=\"https://benspelledabc.me/groundhog_logbook/api/chart/\">here</a>.',0,0,NULL),(37,'2020-07-26','Added Restart Control','I decided to add a feature which allows me to restart the website without having to remote in and do it manually. It\'s restricted but should be fine.',1,0,'uploads/announcements/what_is_new/restartWebsite.png'),(38,'2020-07-27','Added Images To News','Too many times now have I wanted to add an image to the website that wasn\'t a groundhog removal image. I\'ve decided to add images to news posts and I\'ll see how that goes over. To save page loading time, it\'ll only load a \'font awesome\' image of a camera if there is an image for that post. When you click on the camera it\'ll take you to the picture. If you click on the title of the post, it\'ll take you to that post and have a scaled down image of the post. Finally, if you click on the picture on that page, you\'ll get a full size image also.',1,0,''),(39,'2020-07-27','Safer or More Dangerous?','I looked at the CDC website today and noticed that some countries are not reporting COVID cases. Do you think that\'s because they are safer or more dangerous? I\'m happy to be at a place that reports its faults. Without faults we are perfect, or lying.',1,0,''),(40,'2020-08-06','Added a new POLL','I\'ve added a new poll. Vote away! <a href=\"https://benspelledabc.me/polls/6/\">here</a>',1,1,''),(41,'2020-08-06','Grid Defense','A while back great defense pistol upper. I didn’t do load testing on it or anything because I crashed my motorcycle and I just didn’t have time. Since then I have tried it and I keep getting keyholing in the bullets. I’ve sent to barrel back to them they have it I’m not sure what the next step is I hope they replace it. Rumor has it they have good customer service and they will take care of it. Stay tuned I’ll let you know how it goes.',0,0,''),(42,'2020-08-06','Grid Defense','A while back great defense pistol upper. I didn’t do load testing on it or anything because I crashed my motorcycle and I just didn’t have time. Since then I have tried it and I keep getting keyholing in the bullets. I’ve sent to barrel back to them they have it I’m not sure what the next step is I hope they replace it. Rumor has it they have good customer service and they will take care of it. Stay tuned I’ll let you know how it goes.',0,0,''),(43,'2020-08-06','Grid Defense','A while back great defense pistol upper. I didn’t do load testing on it or anything because of personal reasons and I just didn’t have time. Since then I have tried it and I keep getting keyholing in the bullets. I’ve sent to barrel back to them they have it I’m not sure what the next step is I hope they replace it. Rumor has it they have good customer service and they will take care of it. Stay tuned I’ll let you know how it goes.',0,0,''),(44,'2020-08-06','Grid Defense','A while back great defense pistol upper. I didn’t do load testing on it or anything because of personal reasons and I just didn’t have time. Since then I have tried it and I keep getting keyholing in the bullets. I’ve sent to barrel back to them they have it I’m not sure what the next step is I hope they replace it. Rumor has it they have good customer service and they will take care of it. Stay tuned I’ll let you know how it goes.',0,0,''),(45,'2020-08-06','Grid Defense','A while I got a <strong>grid defense</strong>  pistol upper. I didn’t do shot testing on it for several months because of personal reasons and I just didn’t have time. Since then I have tried it and I keep getting keyholing!!. I’ve sent to barrel back to them they have it I’m not sure what the next step is I hope they replace it. Rumor has it they have good customer service and they will take care of it. Stay tuned I’ll let you know how it goes.',0,0,''),(46,'2020-08-06','Grid Defense','A while I got a <strong>grid defense</strong>  pistol upper. I didn’t do shot testing on it for several months because of personal reasons and I just didn’t have time. Since then I have tried it and I keep getting keyholing!!. I’ve sent to barrel back to them they have it I’m not sure what the next step is I hope they replace it. Rumor has it they have good customer service and they will take care of it. Stay tuned I’ll let you know how it goes.',0,0,''),(47,'2020-08-06','Grid Defense','A while I got a <strong>grid defense</strong>  pistol upper. I didn’t do shot testing on it for several months because of personal reasons and I just didn’t have time. Since then I have tried it and I keep getting keyholing!!. I’ve sent to barrel back to them they have it I’m not sure what the next step is I hope they replace it. Rumor has it they have good customer service and they will take care of it. Stay tuned I’ll let you know how it goes.',1,1,''),(48,'2020-08-08','Clearing of the short range','More info later, for now... here’sa picture.',1,0,'uploads/announcements/what_is_new/E2240BF4-C510-4F4C-A55A-9033351967C5.jpeg'),(49,'2020-08-09','Playing PIG','<br /><p>This was my daughter\'s second time shooting. She went for her 9th birthday and now a late 10th bday visit. We are playing PIG and to make things a more even match she gets to be prone with a 3x scope. I\'m sitting, using iron sites and shooting weak hand (left handed/eyed for me). This was hard at first and she got the letter P fairly quickly. Then I figured out how to do get the propper picture so she made it more challanging. She would call the target and add \'Hit the target within X Mississippi\' from low ready. We started with 4 seconds, no wait I\'m sorry.. thats \'4 Mississippis\'. That was hard for a bit but no additional letters were earned. She lowered it to 3 Mississippis and got another letter! Now its PI to null. She lowered it to 2 Mississippis, called the target which was a 4\" target at 20 yards. I shot, I missed. She got PIG.</p>',1,1,'uploads/announcements/what_is_new/paying_pig_yRifwKC.jpeg');
